import React, { PureComponent } from 'react';

//styled
import './App.css'

//components
import SideBar from './components/Sidebar'


class App extends PureComponent {
  render() {
    return (
      <div id="App">
        <SideBar />
        <div id="page-wrap">
          <h1>AppDividend</h1>
          <h2>Check out our tutorials the side menubar</h2>
        </div>
      </div>
    );
  }
}

export default App;
